wn on the site or as per your expectations, you must bring it to the notice of our customer service within same day of receiving the product. The Customer Service Team after looking into your complaint will take an appropriate decision.</p><p><br></p><p>In case of complaints regarding products that come with a warranty from manufacturers, please refer the issue to them.</p><p><br></p><p>In case of any Refunds approved by the OMEGA TECHNOLOGIES, it’ll take 3-5 days for the refund to be processed to the end customer.</p><p><br></p><p><br></p><p><br></p><p>Delivery & Shipping Charge</p><p><br></p><p>1. You can expect to receive your order depending on the delivery option you have chosen.</p><p><br></p><p>2. You can order 24*7 in website & mobile application , Our delivery timings are between 08:00 AM - 08:00PM Same day delivery.</p><p><br></p><p>3.You will be charged a minimal amount as delivery fee according to the distance between your location and warehouse of OMEGA TECHNOLOGIES Enterprise.</p><p><br></p><p>You Agree and Confirm</p><p><br></p><p>1. That in the event that a non-delivery occurs on account of a mistake by you (i.e. wrong name or address or any other wrong information) any extra cost incurred on the way for re-delivery shall be claimed from you.</p><p><br></p><p>2. That you will use the services provided by the Site, its affiliates, consultants and contracted companies, for lawful purposes only and comply with all applicable laws and regulations while using and transacting on the Site.</p><p><br></p><p>3. You will provide authentic and true information in all instances where such information is requested you. OMEGA TECHNOLOGIES reserves the right to confirm and validate the information and other details provided by you at any point of time. </p><p><br></p><p>4. That you are accessing the services available on this Site/App and transacting at your sole risk and are using your best and prudent judgment before entering into any transaction through this Site.</p><p><br></p><p>5. That the address at which delivery of the product ordered by you is to be made will be correct and proper in all respects.</p><p><br></p><p>6. That before placing an order you will check the product description carefully. By placing an order for a product you agree to be bound by the conditions of sale included in the item's description.</p>"]
